o Android, coa previsi\u00f3n de que estea accesible para a s\u00faa descarga a principios de semana. De descarga voluntaria, a aplicaci\u00f3n pode empregala calquera persoa que que se atope en Galicia, sexa  residente ou transe\u00fante. Conectada directamente co Servizo Galego de Sa\u00fade PassCOVID \u00e9 un instrumento de apoio \u00e1 xesti\u00f3n da pandemia e unha canle de contacto telem\u00e1tica cos cidad\u00e1ns.  \n\n  Xunta de Galicia. Informaci\u00f3n mantida e publicada na internet pola Xunta de Galicia Mapa do portal Aviso legal Accesibilidade Alto contraste \n         Contrast: High | Normal", "size": 101835, "download_timeout": 180.0, "download_slot": "amtega.xunta.gal", "download_latency": 1.3925738334655762, "depth": 0, "status": 200, "links_url": "https://amtega.xunta.gal/@@https://amtega.xunta.gal/@@https://amtega.xunta.gal/@@https://amtega.xunta.gal/#main-content@@https://amtega.xunta.gal/@@https://amtega.xunta.gal/es@@https://amtega.xunta.gal/@@https://amtega.xunta.gal/node/233290@@https://amtega.xunta.gal/as-tic-para-ti@@https://ec.europa.eu/regional_policy/es/funding@@https://gaiastech.xunta.gal/gl/nodos/cibergal@@https://gaiastech.xunta.gal/gl/nodos/cibergal@@https://gaiastech.xunta.gal/gl/nodos/galicIA@@https://gaiastech.xunta.gal/gl/nodos/galicIA@@https://amtega.xunta.gal/estratexia-galicia-dixital-2030@@https://amtega.xunta.gal/estratexia-galicia-dixital-2030@@https://amtega.xunta.gal/plans/plans@@https://amtega.xunta.gal/plans/plan-e-mobility@@https://amtega.xunta.gal/plans/dico-mindset@@https://amtega.xunta.gal/documento/plan-de-inclusion-dixital-de-galicia-2020@@https://amtega.xunta.gal/plans/plan-de-banda-larga-2020@@https://amtega.xunta.gal/documento/plan-de-administracion-e-goberno-dixitais-2020@@https://amtega.xunta.gal/plans/plan-galicia-5g@@https://amtega.xunta.gal/plans/estratexia-cloud-do-sector-publico-autonomico@@https://amtega.xunta.gal/plans/plans@@https://amtega.xunta.gal/portais/portais@@https://gaiastech.xunta.gal/@@ht