{"url": "https://www.barciaxalo.gal/", "title": "Salvemos o Val de Barcia e o Monte Xalo", "meta_desc": "Salvemos Val de Barcia e o Monte Xalo, eolicos pero non as\u00ed.", "viewport": "width=1100", "h2": "Menu H@@Buscar nesta web", "h3": "\nSalvemos as Bra\u00f1as -3\n@@\nEncrobas e val de Barcia\n@@\nSalvemos as Bra\u00f1as-2\n@@\nSalvemos as Bra\u00f1as-1\n@@\nPetroglifo de termino nas bra\u00f1as do Torreiro Celas Meirama\n@@\nO NO viario prerroman das Travesas - Carral\n@@\nA Espada na pedra das Bra\u00f1as do Torreiro Celas Meirama\n@@\nMazafacha e Pedra Fachada\n@@\nAlta dunha Asociacion ou Odisea ?\n", "canonical": "https://www.barciaxalo.gal/", "alt_href": "https://www.barciaxalo.gal/feeds/posts/default@@https://www.barciaxalo.gal/feeds/posts/default?alt=rss", "og:url": "https://www.barciaxalo.gal/", "og:title": "Salvemos o Val de Barcia e o Monte Xalo", "og:description": "Salvemos Val de Barcia e o Monte Xalo, eolicos pero non as\u00ed.", "body_text": "Web oficial da Asociaci\u00f3n Salvemos o Val de Barcia e o Monte Xalo \n Inicio \n \n FB \n \n Instagram \n \n TW \n \n Youtube \n \n Asociacion \n \n Calendario \n \n Fotos \n \n Prensa \n \n Aviso Legal \n \n Eolica SI, pero NON ASI \n \n RRSS \n \n Merchandising \n \n Asociate \n \u00a0 ... lembrar ou reivindicar eses espazos como elementos fundamentais para  a rexeneraci\u00f3n ambiental, do os\u00edxeno que respiramos, da auga, \u00e9 tam\u00e9n  como h\u00e1bitats prioritarios de unha grande cantidade de especies animais e  vexetais \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n Vista a\u00e9rea do lago de Encrobas e o val de Barcia. Escoita como o narrador recita porque debemos protexer o noso. Que non nos rouben a terra \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n E tam\u00e9n serviron de pasto, para aquel tam\u00e9n primitivo e escaso gando  dom\u00e9stico que posu\u00edan. Al\u00ed arriba, aquelas sociedades dese\u00f1aron as  primeiras li\u00f1as de tr\u00e1nsito, forxaron as s\u00faas crenzas relixiosas e  constru\u00edron os seus monumentos, tan antigos, e agora en perigo de ser  destru\u00eddos. \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n As bra\u00f1as, os humedais e as terras altas representan dende a  prehistoria, os inicios da paisaxe cultural galega. Milleiros de anos  atr\u00e1s, os constructores dos primeiros monumentos e fundadores do ciclo  agrario cultivaron nos humedais primitivas variedades de cereais de  inverno ... \u00a0 \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n Seguir lendo en http://arqueotoponimia.blogspot.com \u00a0 \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n \u00a0  Seguir lendo en http://arqueotoponimia.blogspot.com \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n Seguir lendo en http://arqueotoponimia.blogspot.com \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n Por se serve para outros, aqu\u00ed deixamos o proceso de alta dunha Asociaci\u00f3n en Galicia. \t Estatutos. Hay modelos por internet. A hora de redactalos tiveronse en conta entre outra cousas: \t Requisitos para ser declarada de Utilidad Publica a vista de dous anos, xa que de ser as\u00ed ter\u00eda unha desgravaci\u00f3n do 80 % da cuota para os socios. \t\t \t\t Sen \t\t\u00e1nimo de lucro, nin repartici\u00f3n de beneficios. \t\t \t\t Sen\u00a0 \t\tideolox\u00eda\u00a0 pol\u00edtica. \t\t \t\t Ampla \t\tcontorna para posible acceso a subvenci\u00f3ns... \t \t \t Acta \tconstitutiva. Hay modelos por internet para tomar coma base. Dado que todos os socios fundadores te\u00f1en que firmar. \t \t Asemblea \tinicial. Na que se aproba Estatutos e Acta constitutiva. Para favorecer o papeleo \u00e9 recomendable que o numero de socios sexa pequeno ... 3 \u00e9 o minimo. \t \t Copia Autentica ( compulsada de toda a vida ). Levala f\u00edsicamente o rexistro da Xunta previo relleno do correspondente formulario de pago. \t \t Xunta. Alta-Rexistro que pode facerse facilmente co Certificado Dixital ou Chave365. O mais c\u00f3modo \u00e9 pasar por un centro de saude ( o mais sinxelo porque todos temos un cerca ) co DNI para pedir o pin da Chave365.  \t \t Solicitar CIF en Facenda. Rellenar e imprimir o correspondente PDF e presentalo online. \t \t Facenda \t-\u00a0 Esenci\u00f3n de IVE cotas socios \t \t \u00a0 Protecci\u00f3n \tDatos - Alta listado. \t \t Apertura de conta bancaria. Dado que temos CIF os bancos consideranos unha \u00bfpyme?, e \u00e9 complicado obter condicions por debaixo de 60 \u20ac/ano.  \t \t Alta \tde socios. O mais c\u00f3modo \u00e9 confeccionar un sinxelo formulario con Google Docs. \u00a0 E por fin xa podemos centrarnos nos fins da asociaci\u00f3n ...\u00a0  \n \n \n \n Enviar por correo electr\u00f3nico Escribe un blog Compartir con Twitter Compartir con Facebook Compartir en Pinterest \n \n", "size": 79451, "download_timeout": 180.0, "download_slot": "www.barciaxalo.gal", "download_latency": 0.25536656379699707, "depth": 0, "status": 200, "links_url": "https://www.barciaxalo.gal/@@https://www.barciaxalo.gal/@@https://www.facebook.com/BarXal/@@https://www.instagram.com/barciaxalo/@@https://twitter.com/xalobarcia@@https://www.youtube.com/channel/UCvrh3e8m0ggrrcPTw5pu0Rg@@https://www.barciaxalo.gal/p/asociacion.html@@https://www.barciaxalo.gal/p/calendari